import React from "react";
import { NavLink } from "react-router-dom";

import "./Header.css";

function Header() {
  return (
    <>
      <header className="headercontainer">
        <div className="headerheading"><h1>Heacker News</h1></div>
        
        <div className="headermenu">
        <NavLink to='/' style={({ isActive }) => ({
    color: isActive ? '#fff' : '#545e6f',
    background: isActive ? '#7600dc' : '#f0f0f0',
  })}><button className="btn">Home</button></NavLink>
        <NavLink to='/new'><button className="btn">New</button></NavLink>
        <NavLink to='/search'><button className="btn">Search</button></NavLink>
        
      </div>
      </header>

      
    </>
  );
}

export default Header;
